import React from 'react';
import Header from './Header';
import Hero from './Hero';
import HighlightsSection from './HighlightsSection';
import Footer from './Footer';
import ParallaxSection from './ParallaxSection';

function HomePage() {
  return (
    <>
      <Header />
      <Hero />
      <ParallaxSection backgroundImage="path-to-water-background.jpg">
        <Typography variant="h4" sx={{ fontWeight: 'bold' }}>
          Experience the Best Fishing Tournaments
        </Typography>
        <Typography variant="body1">
          Join from anywhere, compete with anglers worldwide, and win big.
        </Typography>
      </ParallaxSection>
      <HighlightsSection />
      <ParallaxSection backgroundImage="path-to-nature-background.jpg">
        <Typography variant="h4" sx={{ fontWeight: 'bold' }}>
          Join Our Community
        </Typography>
        <Typography variant="body1">
          Connect with fellow fishing enthusiasts and share your experiences.
        </Typography>
      </ParallaxSection>
      <Footer />
    </>
  );
}

export default HomePage;
